import React from 'react';

function CategoryList(props){
    const category = ['Seafood', 'Beef', 'Port','Chicken','Vegetable']
    return (

       <React.Fragment>
           {
               props.category.map( category=>{
                   return category
               })
           }
       </React.Fragment>

    )
}

export default CategoryList
